create sequence kamar_sq 
    minvalue 1 
    maxvalue 9999 
    start with 1 
    increment by 1 
    cache 20;

create or replace trigger kamar_sq_trig 
before insert on kamar 
for each row 
declare 
  new_id varchar(5); 
  cur_id number; 
begin 
  if inserting and :new.id_kamar is null then 
    cur_id := kamar_sq.nextval; 
    if cur_id < 10 then 
      select concat('K000', cur_id) into new_id from dual; 
    else 
      if cur_id < 100 then 
        select concat('K00', cur_id) into new_id from dual; 
      else 
        if cur_id < 1000 then 
          select concat('K0', cur_id) into new_id from dual; 
        else 
          select concat('K', cur_id) into new_id from dual; 
        end if; 
      end if; 
    end if; 
  :new.id_kamar := new_id; 
  end if; 
end;

